export const Note = (props) => {
    let {title, body,important} = props

    function changeImportant(){
        important = !important
    }

    return (
        <li >
            <p>{title}</p>
            <small><time>{body}</time></small>
            <button onClick={changeImportant()}>{important ? "Important" : "Not important"}</button>
        </li>
    )
}
